import React from "react";

function Login() {
  return (
    <div className="btn-div">
      <a className="btn btn-outline-dark" href="/signup">
        Signup
      </a>
      <a className="btn btn-outline-dark" href="/login">
        Login
      </a>
    </div>
  );
}

export default Login;
